function RecommendChat({id, coverImage, title, index}){
    return ( 
        <div key={id}>  
            <div>
                <div>
                    <img src={coverImage} alt={title}></img>
                </div>
                <div>
                    <p>{title}</p> 
                </div>
            </div>
        </div> 
    );
}


export default RecommendChat;
